(90, 60, 'Home Carousel', '', '<div id=\"myCarousel\" class=\"carousel slide\" data-ride=\"carousel\">\r\n<ol class=\"carousel-indicators\">\r\n<li data-target=\"#myCarousel\" data-slide-to=\"0\" class=\"\"></li>\r\n<li data-target=\"#myCarousel\" data-slide-to=\"1\" class=\"active\"></li>\r\n<li data-target=\"#myCarousel\" data-slide-to=\"2\"></li>\r\n</ol>\r\n<div class=\"carousel-inner\">\r\n<div class=\"carousel-item active carousel-item-left\"><svg class=\"bd-placeholder-img\" width=\"100%\" height=\"100%\" xmlns=\"http://www.w3.org/2000/svg\" preserveaspectratio=\"xMidYMid slice\" focusable=\"false\" role=\"img\"><rect width=\"100%\" height=\"100%\" fill=\"#777\"></rect></svg>\r\n<div class=\"container\">\r\n<div class=\"carousel-caption text-left\">\r\n<h1>Example headline.</h1>\r\n<p>Cras justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit non mi porta gravida at eget metus. Nullam id dolor id nibh ultricies vehicula ut id elit.</p>\r\n<p><a class=\"btn btn-lg btn-primary\" href=\"index.php/default-pages/category-blog/7-sample-post-1\" role=\"button\">Sign up today</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"carousel-item carousel-item-next carousel-item-left\"><svg class=\"bd-placeholder-img\" width=\"100%\" height=\"100%\" xmlns=\"http://www.w3.org/2000/svg\" preserveaspectratio=\"xMidYMid slice\" focusable=\"false\" role=\"img\"><rect width=\"100%\" height=\"100%\" fill=\"#777\"></rect></svg>\r\n<div class=\"container\">\r\n<div class=\"carousel-caption\">\r\n<h1>Another example headline.</h1>\r\n<p>Cras justo odio, dapibus ac facilisis in, egestas eget quam. Donec id elit non mi porta gravida at eget metus. Nullam id dolor id nibh ultricies vehicula ut id elit.</p>\r\n<p><a class=\"btn btn-lg btn-primary\" href=\"index.php/default-pages/category-blog/7-sample-post-1\" role=\"button\">Learn more</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"carousel-item\"><svg class=\"bd-placeholder-img\" width=\"100%\" height=\"100%\"